
series = ""


def match(a, b):
    # if not the same char then fail
    if a.upper() != b.upper(): return False;
    # must be different cases
    return a.isupper() != b.isupper()
    

def remove(in_series, in_letter):
    series = in_series
    letter = in_letter.upper()
    pos = 0
    while pos < len(series):
        # print("B: ...{}...".format(series[pos-5:pos+8]))
        if series[pos].upper() == letter:
            series = series[0:pos] + series[pos+1:]
            # pos is unchanged as the string slid over one
        else:
            pos += 1

    return series    


def collapse(in_series):
    series = in_series
    pos = 0
    while pos < len(series)-1:
        # print("B: ...{}...".format(series[pos-5:pos+8]))
        if match(series[pos],series[pos+1]):
            # print(series[pos],series[pos+1])
            series = series[0:pos] + series[pos+2:]
            pos = max(0, pos-1)
            # print("A: ...{}...".format(series[pos-5:pos+8]))
        else:
            pos += 1
        # print(pos,len(series)-1)

    return series

print(len(collapse(series)))

min = len(series)
test = "dabAcCaCBAcCcaDA"
test = series
for letter in "abcdefghijklmnopqrstuvwxyz":
    x = remove(test, letter)
    # print(test, x)
    c = collapse(x)
    if len(c) < min:
        min = len(c)

print(min)


